import React from 'react';
import About from '../About/About'
import './Header.css'

function Header() {
    return (
        <>
    const pages = [<About />, <Contact />, <Projects />, <Resume />,<Header />]
    const [currentPage, setCurrentPage] = useState(pages[4])
    const name = 'John Nguyen'

    return (
        <div className="App">
        <Nav setCurrentPage={setCurrentPage} pages={pages}/>
        {currentPage}
        <Footer />
        </div>


        <a className='anchor' name="heading">
            {" "}
            <p
                className='title'
                style={{
                    marginTop: "5rem",
                    fontSize: "7rem",
                    fontWeight: "200px",
                    textAlign: "center",
                }}
            >
                John Nguyen
            </p>
        </a>
        </>

    )
}

export default Header;
